    "railroads-eede2",nt"isopen": false,nt"url": null,nt"notes": "The
    Rail Lines layer represents the freight lines of the nation's railroad system. The
    data set covers all 50 states and the District of Colombia, as well as territories
    and possessions of the United States. No raillines exist in American Samoa, Guam,
    Northern Mariana Islands, and the Virgin Islands of the US. This is a completed
    deliverable and is now in maintenance. Rail lines classified as abandoned, removed
    or trails on former rights-of-way may not be realigned. For this release, two rail
    status types have been removed from the databaseAbandoned (STATUS = A), Removed
    (STATUS = R). Abandoned lines are those lines that have been officially designated
    by the Surface Transportation Board as withdrawn from service. Railroads continue
    to own the rights of way, but may elect to remove rail track, ties and ballast.
    Removed lines are those that have had the physical track removed with only the right
    of way remaining. In some instances, the right of way is no long owned by a railroad
    and is only a historical reference. Trails (STATUS = T) are lines that have had
    track removed and the rights of way converted to trails for public use. For trails,
    ownership has been set to 'XXXX', and the LINKID, FROMNODE and TONODE set to 0.
    Passenger-only lines (STATUS = Z) have also had LINKID, FROMNODE and TONODE set
    to 0. Setting these features to 0 removes these links from the routable freight
    rail network.",nt"license_title": "License Not Specified",nt"extras":
